CREATE DEFINER=`root`@`localhost` PROCEDURE `create_user_string_keystrokes_table`()
BEGIN

	START TRANSACTION;
		
        CREATE TEMPORARY TABLE temp_user_string_keystrokes
        SELECT u.id_user, u.id_string, u.key_code, down, up
		FROM (
			SELECT key_code, time as down, id_string, id_user 
			FROM user_keystroke JOIN user_key_string ON (user_keystroke.id_string = user_key_string.id)
			WHERE action = "DOWN"
			ORDER BY id_user, id_string, time
		) as d JOIN (
			SELECT  key_code, time as up, id_string, id_user 
			FROM user_keystroke JOIN user_key_string ON (user_keystroke.id_string = user_key_string.id)
			WHERE action = "UP"
			ORDER BY id_user, id_string, time
		) as u ON (u.up >= d.down AND d.key_code = u.key_code AND d.id_string = u.id_string AND d.id_user = u.id_user)
		GROUP BY u.id_user, u.id_string, u.key_code, down
		ORDER BY u.id_user, u.id_string, down;

		
        INSERT INTO user_string_keystrokes (id_user, id_string, key_code, down, up)
		SELECT  id_user, m.id_string, key_code, down - min_time as down, up - min_time as up
		FROM (
			
			SELECT id_string, min(time) as min_time
			FROM user_keystroke
			GROUP BY id_string
		) as m JOIN temp_user_string_keystrokes ON (m.id_string = temp_user_string_keystrokes.id_string);
        
        DROP TABLE temp_user_string_keystrokes;
        
        BEGIN
        
			
			DECLARE done INT DEFAULT FALSE;
			
			DECLARE _id_user int;
		  
			DECLARE user_cursor CURSOR FOR 
			  SELECT u.id
				FROM user u;
			
			DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

			OPEN user_cursor;

				read_loop: LOOP
					FETCH user_cursor INTO _id_user;
					IF done THEN
					  LEAVE read_loop;
					END IF;
                    
                    SET @r := 0;
					
					BEGIN
			
						DECLARE done_string INT DEFAULT FALSE;
						
						DECLARE _id_string int;
					  
						DECLARE string_cursor CURSOR FOR 
						  SELECT ks.id
							FROM user_key_string ks
                            WHERE id_user = _id_user;
						
						DECLARE CONTINUE HANDLER FOR NOT FOUND SET done_string = TRUE;

						OPEN string_cursor;

							read_string_loop: LOOP
								FETCH string_cursor INTO _id_string;
								IF done_string THEN
								  LEAVE read_string_loop;
								END IF;
								
								SET @r := @r + 1;
								
								UPDATE user_string_keystrokes
                                SET repetition = @r
                                WHERE id_user = _id_user AND id_string = _id_string;
								
							END LOOP;

						CLOSE string_cursor;
						
					END;
					
				END LOOP;

			CLOSE user_cursor;
            
		END;
    
		UPDATE user_string_keystrokes 
		SET 
			down = down * POWER(10, -3),
			up = up * POWER(10, -3);
    
    COMMIT;

END ;;
