CREATE DEFINER=`root`@`localhost` PROCEDURE `reverse_engineering`()
BEGIN

	DECLARE done INT DEFAULT FALSE;
    
    DECLARE _id_user int;
    DECLARE _name varchar(20);
    DECLARE _conversion_base double;
  
	DECLARE user_cursor CURSOR FOR 
	  SELECT u.id, u.name
		FROM user u;
    
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	SET _conversion_base = 1;

	START TRANSACTION;

	OPEN user_cursor;

		read_loop: LOOP
			FETCH user_cursor INTO _id_user, _name;
			IF done THEN
			  LEAVE read_loop;
			END IF;
            
			BEGIN
				DECLARE done_string_cursor INT DEFAULT FALSE;
				
                DECLARE _id_string int;
                
                DECLARE _char VARCHAR(20);
                DECLARE _key_code INT;
                DECLARE _string VARCHAR(20);
                DECLARE _key_duration DOUBLE;
                DECLARE _latency DOUBLE;
                DECLARE _key_duration_string VARCHAR(1000); 
                DECLARE _latency_string VARCHAR(1000);
                
				
                DECLARE string_cursor CURSOR FOR 
					SELECT 
						o.Password,
						o.PR,
						o.RP
						FROM original_pre_processed_data o
					WHERE o.UserName = _name;
				
                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done_string_cursor = TRUE;
    
				OPEN string_cursor;

					read_string_loop: LOOP
                    
						BEGIN 
							
                            DECLARE _key_down double DEFAULT 0;
							DECLARE _key_up double  DEFAULT 0;
                            DECLARE _keys_counter INT DEFAULT 1;
                        
							FETCH string_cursor INTO _string, _key_duration_string, _latency_string;
						
							IF done_string_cursor THEN
							  LEAVE read_string_loop;
							END IF;
							
							
							INSERT INTO user_key_string (id_user, string, date) VALUES (_id_user, _string, NOW());
							SET _id_string = LAST_INSERT_ID();
													
							WHILE _keys_counter <= (LENGTH(_key_duration_string) - LENGTH(REPLACE( _key_duration_string, ";", ""))) DO
								
								IF _keys_counter = 1 THEN
									SET _key_code = 82; SET _char = 'r';
								END IF;
								IF _keys_counter = 2 THEN
									SET _key_code = 72; SET _char = 'h';
								END IF;
								IF _keys_counter = 3 THEN
									SET _key_code = 85; SET _char = 'u';
								END IF;
								IF _keys_counter = 4 THEN
									SET _key_code = 190; SET _char = '.';
								END IF;
								IF _keys_counter = 5 THEN
									SET _key_code = 85; SET _char = 'u';
								END IF;
								IF _keys_counter = 6 THEN
									SET _key_code = 78; SET _char = 'n';
								END IF;
								IF _keys_counter = 7 THEN
									SET _key_code = 73; SET _char = 'i';
								END IF;
								IF _keys_counter = 8 THEN
									SET _key_code = 86; SET _char = 'v';
								END IF;
								IF _keys_counter = 9 THEN
									SET _key_code = 69; SET _char = 'e';
								END IF;
								IF _keys_counter = 10 THEN
									SET _key_code = 82; SET _char = 'r';
								END IF;
								IF _keys_counter = 11 THEN
									SET _key_code = 83; SET _char = 's';
								END IF;
								IF _keys_counter = 12 THEN
									SET _key_code = 73; SET _char = 'i';
								END IF;
								IF _keys_counter = 13 THEN
									SET _key_code = 84; SET _char = 't';
								END IF;
								IF _keys_counter = 14 THEN
									SET _key_code = 89; SET _char = 'y';
								END IF;
								
								SET _latency = case when SUBSTRING_INDEX(SUBSTRING_INDEX(_latency_string,';', _keys_counter - 1), ';', -1) = '' then 0 else SUBSTRING_INDEX(SUBSTRING_INDEX(_latency_string,';', _keys_counter - 1), ';', -1) end;
								SET _key_duration = SUBSTRING_INDEX(SUBSTRING_INDEX(_key_duration_string,';', _keys_counter), ';', -1);
								
								
								SET _key_down = ROUND(_latency * _conversion_base) + _key_up ;
								INSERT INTO user_keystroke (id_string, key_code, time, action, original_char) VALUES (_id_string, _key_code, _key_down, 'DOWN', _char);
								SET _key_up = ROUND(_key_duration * _conversion_base) + _key_down;
								INSERT INTO user_keystroke (id_string, key_code, time, action, original_char) VALUES (_id_string, _key_code, _key_up, 'UP', _char);

								SET _keys_counter = _keys_counter + 1;
							END WHILE;
                            
                        END;
						
					END LOOP;

				CLOSE string_cursor;
			END;
            
		END LOOP;

	CLOSE user_cursor;
    
    COMMIT;

END ;;
